package org.stackspace.spark.exception;

public class MetadataInitializeException extends RuntimeException {

	public MetadataInitializeException() {
		super();
		// TODO Auto-generated constructor stub
	}

	public MetadataInitializeException(String message, Throwable cause,
			boolean enableSuppression, boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

	public MetadataInitializeException(String message, Throwable cause) {
		super(message, cause);
	}

	public MetadataInitializeException(String message) {
		super(message);
	}

	public MetadataInitializeException(Throwable cause) {
		super(cause);
	}

}
